import React, { Component } from 'react';
import {DataTable} from 'primereact/datatable';
import {Column} from 'primereact/column';
import { Card } from 'primereact/card';

class Datatable extends Component {

    constructor() {
        super();
        this.state = {
            representatives: [
                {name: "Amy Elsner", header: 'amyelsner.png'},
                {name: "Anna Fali", header: 'annafali.png'},
                {name: "Asiya Javayant", image: 'asiyajavayant.png'},
                {name: "Bernardo Dominic", image: 'bernardodominic.png'},
                {name: "Elwin Sharvill", image: 'elwinsharvill.png'},
                {name: "Ioni Bowcher", image: 'ionibowcher.png'},
                {name: "Ivan Magalhaes",image: 'ivanmagalhaes.png'},
                {name: "Onyama Limba", image: 'onyamalimba.png'},
                {name: "Stephen Shaw", image: 'stephenshaw.png'},
                {name: "XuXue Feng", image: 'xuxuefeng.png'}
            ]
        };
    }


    render() {
        const { summaryCountries, currentDate } = this.props;

        let cols = [
            {field: 'vin', header: 'Vin'},
            {field: 'year', header: 'Year'},
            {field: 'brand', header: 'Brand'},
            {field: 'color', header: 'Color'}
        ];

        let dynamicColumns = this.state.representatives.map((col,i) => {
            return <Column field={col.name} header={col.header} />;
        });

        return (
            
            <Card>   
                
            <DataTable value={this.state.representatives}>
            {dynamicColumns}

        </DataTable>
        
        
        </Card> 
        );
    }
}

export default Datatable;
